project_contents_026: 
  name: ProjectContent-34
  updated_at: 2007-04-25 21:20:30
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body>   <p align=\"center\"><strong>MAQC Study - Data Generation Plan </strong>(<em>DRAFT) </em></p>  <p align=\"center\"><strong><em>Genospectra Quanti</em></strong><strong><em>G</em></strong><strong><em>ene Platform </em></strong></p>    <p><strong>Test Site </strong></p>  <p>&nbsp;Genospectra, Inc.</p>  <p>Contact person: Yuling Luo </p>  <p>Address: 6519 Dumbarton Circle,  Fremont, CA 94555 </p>  <p>Phone: 510.818.2623</p>  <p>Email: yluo@genospectra.com</p>    <p>&nbsp;<strong>Materials Required </strong></p>    <p>&nbsp;<strong><em>Genospectra Products </em></strong></p>  <ul><li> QuantiGene kits</li><li> Gene-specific probe sets for over 200 genes</li></ul>    <p>&nbsp;</p>  <p><strong><em>Non-Genospectra Products </em></strong></p>  <ul><li> Total RNA, Brain (Ambion)(AB) </li><li> Total RNA, Universal Human Reference RNA (Stratagene) (UHRR)</li><li> Total RNA, Mixture of 75% AB + 25% UHRR</li><li> Total RNA, Mixture of 25% AB + 75% UHRR</li></ul>        <p>&nbsp;</p>  <p><strong><em>Equipment and consumables </em></strong></p>  <ul><li> General laboratory equipment include a 96-well plate-based luminometer (Lmax, Molecular Device) and a hybridization incubator (Hybaid) capable of maintaining temperature between 46&ordm;C and 53&ordm;C.</li><li> General consumables are listed in the QuantiGene assay SOP manual</li></ul>    <p>&nbsp;</p>  <p><strong><em>User Manuals </em></strong></p>  <ul><li> Genospectra QuantiGene Assay SOP Manual</li></ul>  <p>&nbsp;</p>  <p><strong>Experimental Design</strong></p>  <p>&nbsp;</p>  <p>Minimal of 200 genes will be selected for the QuantiGene assay and agreed to by MAQC. The 200 gene will be matched within the ABI&#39;s 1,000 gene list, which will be matched within the list of 5,000 RefSeq genes shared by all microarray platforms. The 200 genes will be selected to cover different expression level, fold changes, and some genes showing cross-platform discrepancy in the pilot study.</p>  <p><strong>&nbsp;</strong></p>  <p><strong>Agreement need to be reached among Genospectra, ABI, and Stratagene for the platform validation assays</strong>. Three, four or five replicate measurements for each gene can be processed for each of the following mRNA samples, depending on the agreement among Genospectra, ABI, and Stratagene: </p>  <p>1. UHRR (100%)</p>  <p>2. AB (25%) vs. UHRR (75%) </p>  <p>3. AB (75%) vs. UHRR (25%) </p>  <p>4. AB (100%)</p>  <p>&nbsp;</p>  <p><strong>Total RNA Preparation and Analysis </strong></p>  <p>&nbsp;</p>  <p>It is assumed that all four total RNA samples will be provided in aqueous solution ready for use.<strong> </strong>The total RNA samples will be stored at -80 <sup>o</sup>C and will be used directly in the QuantiGene assay, unless there is a need to dilute the sample further. No additional manipulation is required for the QuantiGene assay. As a result, we rely on the quality assessment of the original total RNA samples by Ambion and Stratagene.</p>  <p>&nbsp;</p>  <p><strong><em>QuantiGene&reg; assay conditions:</em></strong></p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.&nbsp; Stock total RNA samples will be diluted to [40ng/ul] in RNase Free water. </p>  <p>2.&nbsp; 100 to 800ng of total RNA will be added to each well of QuantiGene assay, depending on the gene expression level.</p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3. Hybridization assay will be carried out per QuantiGene&reg; manual.</p>  <p>4. Background signal for each gene will be assessed in a QuantiGene assay with no sample RNA added, just the probe set.</p>  <p>&nbsp;</p>  <p><strong>Data Acquisition and Analysis </strong></p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; QuantiGene assay signal is measured by a luminometer, and the Relative Luminescent Unit (RLU) data will be directly read from the luminometer machine. The data will be exported into an Excel file and reported directly to MAQC. </p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For those genes (e.g. selected genes from MAQC pilot II study) whose expression in AB and UHRR is substantially different (e.g. over 100: 1 ratio), we expect an assay signal ratio of 100: 75:25:0 ratio for the four total RNA samples. The closeness to the expected 100:75:25:0 ratio will be a measurement of the assay platform accuracy. &nbsp;</p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Once the assay platform accuracy is established, the relative ratio of the 200 genes among different samples will be assessed, and their correlation with the data from other platforms will be compared.</p>  <p>&nbsp;</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Overview of the QuantiGene Workflow</strong></p>  <p><strong>&nbsp;</strong></p>  <p><strong>&nbsp;</strong></p>  <p><strong>Day One:</strong></p>  <p><!--[if gte vml 1]><![endif]--><img alt=\"\" width=\"566\" height=\"2\" /><strong>&nbsp;</strong></p>  <h2>&nbsp;</h2>  <br />  <h2>A.&nbsp;&nbsp;&nbsp;&nbsp; Prepare the QuantiGene<sup>&reg;</sup> Reagents and gene-specific Probe Set</h2>  <p>&nbsp;</p>  <h2>B.&nbsp;&nbsp;&nbsp;&nbsp; Prepare RNA samples for the selected genes.</h2>  <p>&nbsp;</p>  <ol><li>Follow Experimental Layout on      Plate Map.</li></ol>  <p>&nbsp;</p>  <p>&nbsp;</p>  <p>&nbsp;</p>  <p><strong>Day Two:</strong></p>  <p><!--[if gte vml 1]><![endif]--><img alt=\"\" width=\"566\" height=\"2\" /><strong>&nbsp;</strong></p>  <p><strong>&nbsp;</strong></p>  <ol><br /><li>Prepare      the QuantiGene Reagents used for the target mRNA.</li></ol>  <p>&nbsp;</p>  <h2>E.&nbsp;&nbsp;&nbsp;&nbsp; Amplify the Signal and Detect target mRNA.</h2>  <p>&nbsp;</p>  <ol><li>Analyze the Data.</li></ol>  <h1>&nbsp;</h1>  <p>&nbsp;</p>  <strong><u> </u></strong>  <p>&nbsp;</p>  <p align=\"center\"><strong><ins datetime=\"2004-12-13T15:12\" cite=\"mailto:Kate%20Stankis\">QuantiGene </ins>Assay</strong><strong> SOP</strong></p>  <p>PURPOSE:</p>  <p>This protocol describes the procedure for performing, single-plex QuantiGene assays with purified RNA using the LMAX luminometer.</p>  <p>SCOPE:</p>  <p>This procedure applies to all R&amp;D personnel performing a QuantiGene single-plex assay using purified RNA or IVTs as the sample source.</p>  <p>KEY SPONSOR and responsibility: </p>  <p>The R&amp;D Manager is responsible for the content, updating and implementation of this document.</p>  <p>eQUIPMENT:</p>  <p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pipettes, single and multichannel</p>  <p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vortex mixer</p>  <p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LMAX luminometer</p>  <p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Incubators:&nbsp; 46&deg; +/-1.0&deg;C and 53&deg; C +/- 1.0&deg; C</p>  <p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Quick spin bench top micro-centrifuge</p>  <p>mATERIALS</p>  <p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; QuantiGene Assay Kit (at 4&deg;C - capture plates, amplifier, label probe, substrate; at 15-30&deg;C -&nbsp; amplifier/label probe diluent, lysis mixture)</p>  <p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Plastic pipette tips, aerosol resistant</p>  <p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Disposable reagent reservoirs, 25 and 100 mL capacity</p>  <p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Plate Sealers (Bioexpress, Cat. No. T-3025-8B)</p>  <p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10X or 1X Wash Buffer</p>  <p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10% Lithium Lauryl Sulfate solution</p>  <p>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Capture Buffer</p>  <p>8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 mg/mL tRNA (Blocking Agent)</p>  <p>9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purified total RNA, mRNA, or IVT RNA</p>  <p>10. Appropriate Probe Set(s) with pooled Label Extenders, pooled Capture Extenders and pooled Blocking Probes</p>  <p>11. Nuclease Free water </p>    testgs </body> </html>"
