  body_html: "<ul><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">\t                         Tissue injury causes the release of various inflammatory                          and pain mediators resulting in peripheral sensitization<font size=\"-2\">                          1,2,3</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Pain response mediators: ATP, acetylcholine and serotonin                          are released from damaged endothelial cells and platelets;                          prostaglandin E2 is synthesized by Cyclooxygenase I and                          II enzymes in damaged cells; bradykinin is released from                          plasma from damaged vessels<font size=\"-2\"> 1,2</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Inflammatory response mediators: Histamine is released                          from mast cells in response to Substance P and calcitonin                          gene-related peptide (CGRP) released by primary afferent                          sensory fibers; additional mediators are released from                          blood cells (cytokines, complement factors C3a and C5a,                          serotonin, platelet-activating factor, neutrophil chemotactic                          factor, fibrinopeptides, leukotrienes)<font size=\"-2\">                          1,2</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Together with bradykinin and prostaglandins, these inflammatory                          mediators cause peripheral vasodilation, increased vascular                          permeability, plasma extravasation, migration of leucocytes                          to the site of injury, and clotting responses<font size=\"-2\">                          1</font> </font></li></ul>"
