  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> he first choice below connects to the RFC repository maintained by the IETF Secretariat. The second choice connects directly to the RFC Editor&#39;s Web Page. <p>Be advised that there is a slight time period when the two directories will be out of sync. When in doubt, the RFC Editor Web Page is the authoritative source page. <strong>Please Note</strong>: The IETF repository retrieval is for those who know the specific RFC number desired. There is no index or search feature -- those capabilities are available at the RFC Editor Web page.</p><p>&nbsp;</p><p>RFCs associated with an active IETF Working Group can also be accessed from the Working Group&#39;s web page via <a href=\"http://www.ietf.org/html.charters/wg-dir.html\">IETF Working Groups</a>.     </p>  </body> </html>"
