  name: Sop-7
  updated_at: 2007-04-20 12:53:30
  body_html: "<h2><span class=\"mw-headline\">Cell proliferation</span></h2> <p>Proliferation assays are based on direct cell counting, thymidine incorporation or staining techniques for <a href=\"http://en.wikipedia.org/wiki/Cell_growth\" title=\"Cell growth\">cell proliferation</a> or death and takes advantage of the proliferation of <a href=\"http://en.wikipedia.org/wiki/Endothelial_cells\" title=\"Endothelial cells\">endothelial cells</a> after stimulation with <a href=\"http://en.wikipedia.org/wiki/Cytokine\" title=\"Cytokine\">cytokines</a>. The source of endothelial cells may influence the outcome of tests validating angiogenic activity, as endothelial cells originating from large vessels differ from endothelial cells from microvasculature, and endothelial cells from different organs may have distinct properties. Another aspect to consider is that endothelial cells used in laboratory assays are in a <a href=\"http://en.wikipedia.org/wiki/Wound_healing\" title=\"Wound healing\">proliferative phase</a>, compared to endothelial cells in a mature resting vessel in a steady state with low levels of cell proliferation and migration.</p> <p><a id=\"Endothelial_cell_migration\" name=\"Endothelial_cell_migration\" title=\"Endothelial_cell_migration\"></a></p> <h2><span class=\"editsection\">[<a href=\"http://en.wikipedia.org/w/index.php?title=Angiogenesis_assays&amp;action=edit&amp;section=2\" title=\"Edit section: Endothelial cell migration\">edit</a>]</span> <span class=\"mw-headline\">Endothelial cell migration</span></h2> <p>Migration assays are based on the ability of endothelial cells to migrate in response to chemotactic stimuli. Most assays use different variants of the Boyden chamber, in which two compartments are separated by a filter membrane with a pore size that allows endothelial cells to pass by active migration. When endothelial cells are added to the top well, chemotactic solutions are placed in the lower well and cells that have migrated toward the chemotactic stimulus are counted after a period of incubation. The migrated cells on the other side of the membrane can be counted manually.</p> <p><a id=\"Cell_matrix_interactions\" name=\"Cell_matrix_interactions\" title=\"Cell_matrix_interactions\"></a></p> <h2><span class=\"editsection\">[<a href=\"http://en.wikipedia.org/w/index.php?title=Angiogenesis_assays&amp;action=edit&amp;section=3\" title=\"Edit section: Cell matrix interactions\">edit</a>]</span> <span class=\"mw-headline\">Cell matrix interactions</span></h2> <p>The most commonly used assay to study cell-matrix interactions is the cell adhesion assay. Adhesion of endothelial cels to <a href=\"http://en.wikipedia.org/wiki/Extracellular_matrix\" title=\"Extracellular matrix\">extracellular matrix</a> proteins, such as collagen IV, laminin, vitronectin, and fibronectin, is mediated by various surface receptors belonging to several families, such as integrins and cell surface proteoglycans. Interactions between matrix proteins and endothelial cells play important roles in cell survival, proliferation and migration.</p> <p><a id=\"Tube_formation\" name=\"Tube_formation\" title=\"Tube_formation\"></a></p> <h2><span class=\"editsection\">[<a href=\"http://en.wikipedia.org/w/index.php?title=Angiogenesis_assays&amp;action=edit&amp;section=4\" title=\"Edit section: Tube formation\">edit</a>]</span> <span class=\"mw-headline\">Tube formation</span></h2> <p>Another approach is to study the formation of <a href=\"http://en.wikipedia.org/wiki/Capillary\" title=\"Capillary\">capillary</a>-like tubes when endothelial cells are cultured on Matrigel, a mixture of extracellular and <a href=\"http://en.wikipedia.org/wiki/Basal_lamina\" title=\"Basal lamina\">basement membrane</a> proteins, particularly laminin, prepared from Engelbreth-Holm-Swarm (EHS) mouse tumors. Tube formation during angiogenesis involves complex cell-cell and cell-matrix interactions. This method is fast, but it is not clear if the &ldquo;tubules&rdquo; really possess a lumen. It is reported that cells of non-endothelial origin, such as <a href=\"http://en.wikipedia.org/wiki/Fibroblast\" title=\"Fibroblast\">fibroblasts</a>, can form tubule-like strands on Matrigel. Results from this assay should therefore be interpreted with great caution.</p>"
